import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
import dayjs from "dayjs/esm/index.js";
const generateSalesCheck = (data) => {
  //Instanciamos el constructor del PDF

  let fecha = data.fecha.split("T");
  //Destructurando el json para la tabla
  let factura = [];
  factura.push([]);
  factura[0].push(data.producto + " " + data.unidad_medida);
  factura[0].push(data.cantidad);
  factura[0].push(data.precio_uni);
  factura[0].push(data.subtotal);

  const doc = new jsPDF({ orientation: "p", unit: "mm", format: "legal" });
  
  var img =
    "data:image/png;base64,";

  doc.addImage(img, "JPEG", 10, 17, 35, 35);
  doc.text(45, 20, "Aroma que te hace soñar, sabor que te hace derpertar!!!");

  doc.text(130, 30, "Café Vida");
  doc.text(130, 35, "Cantón Pachicaj, Santiago");
  doc.text(130, 40, "Atitlán Sololá, Sololá");
  doc.text(130, 45, "5763-1918");
  doc.text(130, 50, "caffevida02@gmail.com");

  doc.line(15, 60, 200, 60);

  doc.text(130, 70, `Factura No. ${data.factura}`);
  doc.text(130, 75, `Fecha: ${dayjs(fecha[0]).format('DD/MM/YYYY')}`);

  doc.text(30, 75, "Datos del receptor: ");
  doc.text(30, 80, `Nombre: ${data.cliente}`);

  doc.line(15, 90, 200, 90);

  autoTable(doc, {
    head: [["Descripcion", "Cantidad", "Precio Unitario", "Subtoal"]],
    body: factura,
    startY: 100,
    theme: "plain",
  });

  doc.text(160, 180, `Subtotal: ${data.subtotal}`);
  doc.text(160, 185, `Descuento: ${data.descuento}`);
  doc.text(160, 190, `Total: ${data.total}`);

  /* doc.save("factura.pdf"); */
  doc.output("dataurlnewwindow", `${data.cliente}`);
};

export default generateSalesCheck;
